import React, {useEffect, useState} from 'react'
import styled from 'styled-components'

export const Vote = () => {

    let AssetsTab = [];

    useEffect(() => {
        fetch('https://auth.etna-alternance.net/api/users/')
        .then(res => console.log(res))
    })

    return (
        <Container>
            <TitleBox>
                Best ASSETS AP 2025
            </TitleBox>
            <PicturesContainer>
                <PictureLine>
                    <div style={{display: "flex", justifyContent: "center", flexDirection: "column", alignItems: "center"}}>
                        <Picture src="https://auth.etna-alternance.net/api/users/nakach_v/photo?size=medium"/>
                        <Name> Vincent Nakach </Name>
                    </div>

                    <div style={{display: "flex", justifyContent: "center", flexDirection: "column", alignItems: "center"}}>
                        <Picture src="https://auth.etna-alternance.net/api/users/nakach_v/photo?size=medium"/>
                        <Name> Vincent Nakach </Name>
                    </div>
                    <div style={{display: "flex", justifyContent: "center", flexDirection: "column", alignItems: "center"}}>
                        <Picture src="https://auth.etna-alternance.net/api/users/nakach_v/photo?size=medium"/>
                        <Name> Vincent Nakach </Name>
                    </div>
                    <div style={{display: "flex", justifyContent: "center", flexDirection: "column", alignItems: "center"}}>
                        <Picture src="https://auth.etna-alternance.net/api/users/nakach_v/photo?size=medium"/>
                        <Name> Vincent Nakach </Name>
                    </div>
                    <div style={{display: "flex", justifyContent: "center", flexDirection: "column", alignItems: "center"}}>
                        <Picture src="https://auth.etna-alternance.net/api/users/nakach_v/photo?size=medium"/>
                        <Name> Vincent Nakach </Name>
                    </div>
                </PictureLine>
            </PicturesContainer>
        </Container>
    )
}

const PictureLine = styled.div`
    display: flex;
    justify-content: space-between;
    width: 100%;


`
const Name = styled.div`
    display: flex;
    margin-top: 10px;
    font-size: 20px;
    font-style: bold;
`
const Picture = styled.img`
    width: 200px;
    height: 240px;
`

const PicturesContainer = styled.div`
    display: flex;
    width: 80%;
    background-color: red;
    height: 100%;
    margin-top: 100px;
    justify-content: space-between;
`

const TitleBox = styled.div`
    position: fixed;
    display: flex;
    height: 100px;
    width: 100%;
    justify-content: center;
    align-items: center;
    font-size: 30px;
    font-style: bold;
    background-color: #7dbdd4;

`

const Container = styled.div`
    display: flex;

    width: 100%;
    height: 100%;
    justify-content: center;
`
